const Track = ({ track, onPlay, isPlaying }) => {
  const { title } = track;

  return (
    <div className="track">
      <h4>{track.title}</h4>
      <audio src={`assets/albums/${track.albumId}/tracks/${track.id}.mp3`} controls />
    </div>

  );
};

export default Track;
